import { useRouter } from 'next/router';
import React from 'react';
import ExploreHeader from '../../components/layout/ExploreHeader';

export default () => {
  const router = useRouter();
  return (
    <>
      <ExploreHeader />
      <h1>{router.query.id}</h1>
    </>
  );
};
